// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

import "./Whitelist.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "./INagaKidsNFT.sol";

contract MintNagaKids is Whitelist, AccessControl, ReentrancyGuard {

    INagaKidsNFT public nagaKidsContract;
    bool public isFreeMintOpen;
    bool public isWhitelistOpen;

    constructor(INagaKidsNFT _nagaKids,bytes32 _merkleRoot) {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        changeNagaKidsContract(_nagaKids);
        setMerkleRoot(_merkleRoot);
    }

    modifier Paused() {
        require(isPause() == false,"NagaKids was Paused.");
        _;
    }

    function changeNagaKidsContract(INagaKidsNFT _nagaKids) public onlyRole(DEFAULT_ADMIN_ROLE) {
        nagaKidsContract = _nagaKids;
    }

    function changeWhitelistMintOpen(bool _isOpen) public onlyRole(DEFAULT_ADMIN_ROLE) {
        isWhitelistOpen = _isOpen;
    }

    function changeFreeMintOpen(bool _isOpen) public onlyRole(DEFAULT_ADMIN_ROLE) {
        isFreeMintOpen = _isOpen;
    }
    
    function setMerkleRoot(bytes32 _merkleRoot) public onlyRole(DEFAULT_ADMIN_ROLE) {
        merkleRoot = _merkleRoot;
    }

    function whitelistMint(bytes32[] memory _proofMerkle,uint256 amount) public payable nonReentrant Paused {
        require(isWhitelistOpen == true, "Whitelist not open to mint.");
        require(getTotalSupply() < 1111, "Over supply");
        require(nagaKidsContract.hasRole(nagaKidsContract.MINTER_ROLE(),address(this)) == true,"This Contract not have permission to mint.");
        nagaKidsContract.safeMint(msg.sender);
    }

    function getTotalSupply() public view returns (uint256) {
        return nagaKidsContract.totalSupply();
    }

    function getMaxSupply() public view returns (uint256) {
        return nagaKidsContract.maxSupply();
    }

    function isPause() public view returns (bool) {
        return nagaKidsContract.paused();
    }
}

